In this final episode, Sam and Mariah learn about equitable access efforts at Mianus River Gorge Preserve and visit Block Island, which we’ve deemed one of the “Last Great Places” in the western hemisphere. They cap off the trip with an important conversation on climate policy in Boston, plus an up-close look at the impact of our river restoration efforts and the return of alewives to Maine’s waterways. 

